CREATE FUNCTION mobility.get_fare_prices(_src_station character varying, _trg_station character varying, _jap boolean DEFAULT false) RETURNS TABLE(fare_adult integer, fare_kids integer)
    LANGUAGE plpgsql
    AS $_$
begin
	return query execute format(
		$q$
		with fare_by_km(l_bound,u_bound,fare_adult,fare_kids) as (
			values --from Tokyo metro website prices
			(0,6.9,180,90),
			(7,11.9,210,110),
			(12,19.9,260,130),
			(20,27.9,300,150),
			(28,40,330,170)
		)
		, grouped_fare as (
			select 
				(count(transit_company)-1)::int4 transfers,
				sum(fare_adult)::int4 fare_adult,
				sum(fare_kids)::int4 fare_kids
			from other.get_lines_and_distance(
				'%1$s',
				'%2$s',
				$1
			) d
			join fare_by_km f on d.distance between f.l_bound and f.u_bound
		)
		select 
			fare_adult - (transfers*50) fare_adult, --discount
			fare_kids - (transfers*50) fare_kids --discount
		from grouped_fare;
		$q$, _src_station, _trg_station
	) using _jap;
end
$_$;


