CREATE FUNCTION mobility.get_payment(_src_station character varying, _trg_station character varying, _number_adults integer, _number_kids integer, _jap boolean DEFAULT false) RETURNS integer
    LANGUAGE plpgsql
    AS $_$
declare 
	_payment int4;
begin
	execute format(
		$q$
		select 
			(fare_adult * $2) + (fare_kids * $3) payment
		from other.get_fare_prices(
				'%1$s','%2$s',$1
		);
		$q$, _src_station, _trg_station
	) using _jap,_number_adults,_number_kids into _payment;
	return _payment;
end
